import React from "react";
import ExpenseItem from "./ExpenseItem";

const ExpensesList = props => {

    let expensesContent = <p>No data in the list </p>;

    if (props.items.length > 0) {
        expensesContent = props.items.map((expense, index) => <ExpenseItem key={expense.id} title={expense.title} amount={expense.amount} date={expense.date}/>)
    }

}

export default ExpensesList;
